import React from "react";
import "./popup.css";

export const Popup = ({ msg }) => {
  return (
    <div className="popup">
      <div className="popup-wrapper">
        <div className="popup-arrow"></div>
        <div className="popup-banner">
          <span className="popup-msg">{msg}</span>
        </div>
      </div>
    </div>
  );
};
